window.Ladder=class{listeners={startHead:[],endHead:[],startBody:[],endBody:[]};once(t,e){switch(t){case"startHead":{this.listeners.startHead.push(e);break}case"endHead":{this.listeners.startHead.push(e);break}case"startBody":{this.listeners.startBody.push(e);break}case"endBody":{this.listeners.endBody.push(e);break}default:console.warn(`Ignoring invalid event: "${t}"`)}}setup(){let t=new MutationObserver(()=>{document.head&&(this.listeners.startHead.forEach(s=>s()),t.disconnect())}),e=new MutationObserver(()=>{document.body&&(document.addEventListener("DOMContentLoaded",()=>this.listeners.endBody.forEach(s=>s())),this.listeners.startBody.forEach(s=>s()),e.disconnect())});t.observe(document,{childList:!0,subtree:!0}),e.observe(document,{childList:!0,subtree:!0})}};
